import React from 'react'
import { FaTrashAlt } from 'react-icons/fa';
import { LineItem } from './LineItem';

export const ItemsList = ({items,handleCheck,handleDelete}) => {
  return (
    <ul>
        {items.map((item) => (
          <LineItem 
          items = {items}
      handleCheck = {handleCheck}
      handleDelete = {handleDelete}/>
        ))}
    </ul>
  )
}
